import React, { useState } from "react";

export default function ProjectCard({ project, deleteProject }) {
  const [expanded, setExpanded] = useState(false);
  const [lightboxIndex, setLightboxIndex] = useState(null); // Track which image is open
  const isImage = (filename) => /\.(png|jpe?g|gif|webp)$/i.test(filename);

  const openLightbox = (index) => setLightboxIndex(index);
  const closeLightbox = () => setLightboxIndex(null);

  return (
    <div
      className="project-card"
      style={{ border: "1px solid #ccc", padding: 10, margin: 8, borderRadius: 8 }}
    >
      {/* Card header */}
      <div onClick={() => setExpanded(!expanded)} style={{ cursor: "pointer" }}>
        <strong>{project.name}</strong> â€” {project.status}<br />
        <em>{project.role}</em><br />
        {project.start_date} - {project.end_date || "Present"}
      </div>

      {/* Expanded details */}
      {expanded && (
        <div style={{ marginTop: 10 }}>
          <p>{project.description}</p>

          {project.skills_used?.length > 0 && (
            <p><strong>Skills:</strong> {project.skills_used.join(", ")}</p>
          )}
          {project.industry_type && <p><strong>Industry:</strong> {project.industry_type}</p>}
          {project.team_size && <p><strong>Team Size:</strong> {project.team_size}</p>}
          {project.details && <p><strong>Details:</strong> {project.details}</p>}
          {project.outcomes && <p><strong>Outcomes:</strong> {project.outcomes}</p>}

          {/* Media files */}
          {project.media_files?.length > 0 && (
            <div style={{ display: "flex", flexWrap: "wrap", gap: "6px" }}>
              {project.media_files.map((file, idx) =>
                isImage(file.filename) ? (
                  <img
                    key={idx}
                    src={`data:${file.content_type};base64,${file.data}`}
                    alt={file.filename}
                    style={{ width: 100, height: 100, objectFit: "cover", cursor: "pointer", borderRadius: 4 }}
                    onClick={() => openLightbox(idx)}
                  />
                ) : (
                  <span key={idx} style={{ display: "block" }}>ðŸ“Ž {file.filename}</span>
                )
              )}
            </div>
          )}
        </div>
      )}

      {/* Delete button */}
      <button
        style={{ marginTop: 6, background: "#ff4d4f", color: "#fff", border: "none", padding: "6px 10px", borderRadius: 4, cursor: "pointer" }}
        onClick={() => deleteProject(project.id)}
      >
        ðŸ—‘ Delete
      </button>

      {/* Lightbox modal */}
      {lightboxIndex !== null && (
        <div
          onClick={closeLightbox}
          style={{
            position: "fixed",
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            backgroundColor: "rgba(0,0,0,0.8)",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            zIndex: 1000,
            cursor: "zoom-out",
          }}
        >
          <img
            src={`data:${project.media_files[lightboxIndex].content_type};base64,${project.media_files[lightboxIndex].data}`}
            alt={project.media_files[lightboxIndex].filename}
            style={{ maxWidth: "90%", maxHeight: "90%", borderRadius: 8 }}
          />
        </div>
      )}
    </div>
  );
}
